/*Function for toggling menu*/ let menuList = document.querySelector("#menuList");
menuList.style.maxHeight = "0px";
function menuToggle() {
    if (menuList.style.maxHeight == "0px") menuList.style.maxHeight = "200px";
    else menuList.style.maxHeight = "0px";
}

